import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Import the CSS file for styling
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser } from '@fortawesome/free-solid-svg-icons';
import { faHome } from '@fortawesome/free-solid-svg-icons';
import { faSignInAlt } from '@fortawesome/free-solid-svg-icons';
import { faUserPlus } from '@fortawesome/free-solid-svg-icons';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-left">
        <h3 className="navbar-title"><span style={{ color: 'blue' }}><FontAwesomeIcon icon={faUser} className="navbar-icon" />Talent</span>Stream</h3>
      </div>
      <ul className="navbar-list">
        <li className="navbar-item">
          <Link to="/" className="navbar-link"><FontAwesomeIcon icon={faHome} />Home</Link>
        </li>
        <li className="navbar-item">
          <Link to="/about" className="navbar-link"><FontAwesomeIcon icon={faUser} />About</Link>
        </li>
        <li className="navbar-item">
          <Link to="/register" className="navbar-link"><FontAwesomeIcon icon={faUser} />Register</Link>
        </li>
        <li className="navbar-item">
          <Link to="/login" className="navbar-link"><FontAwesomeIcon icon={faSignInAlt} />Login</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
